import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes.js";

function createNotes(noteItem){
  return <Note />
};

function App() {
  return (
    <div>
      <Header />
      {notes.map(<Note 
          title = {notes.title}
          content = {notes.content}
          />)}
      <Footer />
    </div>
  );
}

export default App;
